import React from 'react';

// Components
import CardNameInput from './CardNameInput';
import ExpDateInput from './ExpDateInput';
import CardNumberInput from './CardNumberInput';
import CvcInput from './CvcInput';
import Submit from './Submit';

function Form({setCardNumber, setCardName, setExpMonth, setExpYear, setCvc}) {
  return (
    <div className='w-[45%] h-full flex items-center'>
      <form className='w-[50%] flex flex-col gap-5' action="">
        <CardNameInput setCardName={setCardName} />
        <CardNumberInput />
        <div className='w-full flex justify-between gap-2'>
          <ExpDateInput />
          <CvcInput />
        </div>
        <Submit />
      </form>
    </div>
  )
}
export default Form;
